from unittest import TestCase

import decodeMorse


class TestDecodeMorse(TestCase):
    def test1(self):
        self.assertEqual('HEY JUDE', decodeMorse.decodeMorse('.... . -.--   .--- ..- -.. .'))

    def test2(self):
        self.assertEqual('HEY JUDE', decodeMorse.decodeMorse(decodeMorse.decodeBits('1100110011001100000011000000111111001100111111001111110000000000000011001111110011111100111111000000110011001111110000001111110011001100000011')))

    def test3(self):
        self.assertEqual('EE', decodeMorse.decodeMorse(decodeMorse.decodeBits('10001')))

    def test4(self):
        self.assertEqual('E', decodeMorse.decodeMorse(decodeMorse.decodeBits('1')))

    def test5(self):
        self.assertEqual('A', decodeMorse.decodeMorse(decodeMorse.decodeBits('10111')))

    def test6(self):
        self.assertEqual('E', decodeMorse.decodeMorse(decodeMorse.decodeBits('11')))

    def test7(self):
        self.assertEqual('E', decodeMorse.decodeMorse(decodeMorse.decodeBits('1110')))

    def test8(self):
        self.assertEqual('I', decodeMorse.decodeMorse(decodeMorse.decodeBits('111000111')))

    def test9(self):
        self.assertEqual('I', decodeMorse.decodeMorse(decodeMorse.decodeBits('111110000011111')))

    def test10(self):
        self.assertEqual('EE', decodeMorse.decodeMorse(decodeMorse.decodeBits('111000000000111')))

    def test11(self):
        self.assertEqual('S', decodeMorse.decodeMorse(decodeMorse.decodeBits('111000111000111')))

    def test12(self):
        self.assertEqual('HEY JUDE', decodeMorse.decodeMorse(decodeMorse.decodeBits('')))

    def test13(self):
        self.assertEqual('E', decodeMorse.decodeMorse(decodeMorse.decodeBits('01110')))

    def test14(self):
        self.assertEqual('E', decodeMorse.decodeMorse(decodeMorse.decodeBits('000000011100000')))

    def test15(self):
        self.assertEqual('THE QUICK BROWN FOX JUMPS OVER THE LAZY DOG.', decodeMorse.decodeMorse(decodeMorse.decodeBits('')))

    def test16(self):
        self.assertEqual('E E', decodeMorse.decodeMorse(decodeMorse.decodeBits('100000001')))

    def test17(self):
        self.assertEqual('M', decodeMorse.decodeMorse(decodeMorse.decodeBits('1110111')))

    def test18(self):
        self.assertEqual('M', decodeMorse.decodeMorse(decodeMorse.decodeBits('11111100111111')))